static int table_parsing_data_S6E3HAB_AMB677TY01(struct samsung_display_driver_data *vdd,
		struct brightness_table *br_tbl)
{
	struct hbm_table_format {
		unsigned char aor[AOR_SIZE];
		unsigned char vint[VINT_SIZE];
		unsigned char elvss[ELVSS_SIZE];
		unsigned char irc[IRC_SIZE];
	}__packed;

	struct normal_table_format {
		unsigned char gamma[GAMMA_SIZE];
		unsigned char aor[AOR_SIZE];
		unsigned char vint[VINT_SIZE];
		unsigned char elvss[ELVSS_SIZE];
		unsigned char irc[IRC_SIZE];
	}__packed;

	struct hmd_table_format {
		unsigned char gamma[GAMMA_SIZE];
		unsigned char aor[AOR_SIZE];
	}__packed;

	struct hbm_table_format *hbm_table;
	struct normal_table_format *normal_table;
	struct hmd_table_format *hmd_table;

	int hbm_step;
	int normal_step;
	int hmd_step;

	int input_table_size;

	struct flash_raw_table *gamma_tbl = br_tbl->gamma_tbl;
	unsigned char *dst = gamma_tbl->br_data_raw;
	int loop;

	if (IS_ERR_OR_NULL(dst)) {
		panic("br_data_raw is not available");
		return -ENXIO;
	}

	hbm_table = (struct hbm_table_format *)table_hbm_br_info;
	normal_table = (struct normal_table_format *)table_normal_br_info;
	hmd_table = (struct hmd_table_format *)table_hmd_br_info;

	if (br_tbl->refresh_rate == 60 && br_tbl->is_sot_hs_mode) {
		normal_table = (struct normal_table_format *)table_normal_br_info_60hs;
	} else if (br_tbl->refresh_rate == 120 || br_tbl->refresh_rate == 96) {
		normal_table = (struct normal_table_format *)table_normal_br_info_120hs;
	}

	hbm_step = (int)sizeof(table_hbm_br_info) / (int)sizeof(struct hbm_table_format);
	normal_step = (int)sizeof(table_normal_br_info) / (int)sizeof(struct normal_table_format);
	hmd_step = (int)sizeof(table_hmd_br_info) / (int)sizeof(struct hmd_table_format);

	input_table_size = sizeof(table_hbm_br_info) + sizeof(table_normal_br_info) + sizeof(table_hmd_br_info);

	LCD_INFO("input_table_size (%d) = table_hbm_br_info (%d) + table_normal_br_info (%d) + table_hmd_br_info (%d)\n",
		input_table_size, sizeof(table_hbm_br_info), sizeof(table_normal_br_info), sizeof(table_hmd_br_info));

	if (input_table_size > gamma_tbl->br_data_size) {
		LCD_ERR("input_table_size : %d br_tbl->gamma_tbl->br_data_size : %d\n",
			input_table_size, br_tbl->gamma_tbl->br_data_size);

		panic("table size mismatch");
	}

	LCD_INFO("hbm_step : %d normal_step : %d hmd_step : %d", hbm_step, normal_step, hmd_step);

	/* hbm data update */
	for (loop = 0; loop < hbm_step; loop++) {
		memcpy(dst + gamma_tbl->flash_table_hbm_aor_offset + (AOR_SIZE * loop), hbm_table[loop].aor, AOR_SIZE);
		memcpy(dst + gamma_tbl->flash_table_hbm_vint_offset + (VINT_SIZE * loop), hbm_table[loop].vint, VINT_SIZE);
		memcpy(dst + gamma_tbl->flash_table_hbm_elvss_offset + (ELVSS_SIZE * loop), hbm_table[loop].elvss, ELVSS_SIZE);
		memcpy(dst + gamma_tbl->flash_table_hbm_irc_offset + (IRC_SIZE * loop), hbm_table[loop].irc, IRC_SIZE);
	}

	/* hbm max gamma update - read in br_basic_register_read() */
	memcpy(dst + gamma_tbl->flash_table_hbm_gamma_offset, br_tbl->hbm_max_gamma, GAMMA_SIZE);

	/* normal data update */
	for (loop = 0; loop < normal_step; loop++) {
		memcpy(dst + gamma_tbl->flash_table_normal_gamma_offset + (GAMMA_SIZE * loop), normal_table[loop].gamma, GAMMA_SIZE);
		memcpy(dst + gamma_tbl->flash_table_normal_aor_offset + (AOR_SIZE * loop), normal_table[loop].aor, AOR_SIZE);
		memcpy(dst + gamma_tbl->flash_table_normal_vint_offset + (VINT_SIZE * loop), normal_table[loop].vint, VINT_SIZE);
		memcpy(dst + gamma_tbl->flash_table_normal_elvss_offset + (ELVSS_SIZE * loop), normal_table[loop].elvss, ELVSS_SIZE);
		memcpy(dst + gamma_tbl->flash_table_normal_irc_offset + (IRC_SIZE * loop), normal_table[loop].irc, IRC_SIZE);
	}

	/* normal max gamma update - 60HS/120HS : read in br_basic_register_read() */
	memcpy(dst + gamma_tbl->flash_table_normal_gamma_offset, br_tbl->normal_max_gamma, GAMMA_SIZE);

	/* hmd data update */
	for (loop = 0; loop < hmd_step; loop++) {
		memcpy(dst + gamma_tbl->flash_table_hmd_gamma_offset + (GAMMA_SIZE * loop), hmd_table[loop].gamma, GAMMA_SIZE);
		memcpy(dst + gamma_tbl->flash_table_hmd_aor_offset + (AOR_SIZE * loop), hmd_table[loop].aor, AOR_SIZE);
	}

	return 0;
}

static int table_parsing_data_hmd_S6E3HAB_AMB677TY01(struct samsung_display_driver_data *vdd,
		struct brightness_table *br_tbl)
{
	struct hmd_table_format {
		unsigned char gamma[GAMMA_SIZE];
		unsigned char aor[AOR_SIZE];
	}__packed;

	struct hmd_table_format *hmd_table;
	int hmd_step;

	struct flash_raw_table *gamma_tbl = br_tbl->gamma_tbl;
	unsigned char *dst = gamma_tbl->br_data_raw;
	int loop;

	if (IS_ERR_OR_NULL(dst)) {
		panic("br_data_raw is not available");
		return -ENXIO;
	}

	hmd_table = (struct hmd_table_format *)table_hmd_br_info;
	hmd_step = (int)sizeof(table_hmd_br_info) / (int)sizeof(struct hmd_table_format);

	LCD_INFO("hmd_step : %d", hmd_step);

	/* hmd data update */
	for (loop = 0; loop < hmd_step; loop++) {
		memcpy(dst + gamma_tbl->flash_table_hmd_gamma_offset + (GAMMA_SIZE * loop), hmd_table[loop].gamma, GAMMA_SIZE);
		memcpy(dst + gamma_tbl->flash_table_hmd_aor_offset + (AOR_SIZE * loop), hmd_table[loop].aor, AOR_SIZE);
	}

	LCD_INFO("hmd_step : %d --", hmd_step);

	return 0;
}

static int fill_non_flash_data_S6E3HAB_AMB677TY01(struct samsung_display_driver_data *vdd,
		struct brightness_table *br_tbl)
{
	struct dimming_tbl *normal_tbl = &br_tbl->normal_tbl;
	int normal_brightness_step = vdd->br_info.normal_brightness_step;
	int column, data_cnt;
	int dbv_size = vdd->br_info.dbv_size;
	unsigned char **dbv = normal_tbl->dbv;

	/* TODO: get initial value from dbf_offset as the ohter value is added to
	 * table_normal_non_flash_br_info.. Refer to update_br_info_normal().
	 */
	int tbl_index = 0;

	for (column = 0; column < normal_brightness_step; column++) {
		/* Fill data from non-DDI-flash, like DBV data, which is shared via op code */
		if (test_bit(BR_NORMAL_DBV, vdd->br_info.panel_br_info.br_info_select)) {
			for (data_cnt = 0; data_cnt < dbv_size; data_cnt++)
				dbv[column][data_cnt] = table_normal_non_flash_br_info[tbl_index++];
		}
	}

	return 0;
}

static int table_gamma_update_S6E3HAB_AMB677TY01(struct samsung_display_driver_data *vdd,
		struct brightness_table *br_tbl)
{
	struct dimming_tbl *normal_tbl = &br_tbl->normal_tbl;
	struct dimming_tbl *hmd_tbl = &br_tbl->hmd_tbl;

	int normal_step = vdd->br_info.normal_brightness_step;
	int hmd_step = vdd->br_info.hmd_brightness_step;

	int *normal_candela_table = normal_tbl->candela_table;
	int *hmd_candela_table = hmd_tbl->candela_table;

	int loop;

	/*
		hbm gamma use interpoltion logic & interpolation hbm gamma is updated at gen_hbm_interpolation_gamma().
		So, hbm gamma use ss_interpolation->hbm->gamma
	*/

	/* 1st : normal gamma update */
	for (loop = 0; loop < normal_step; loop++)
		br_tbl->smart_dimming_dsi->generate_gamma(
					br_tbl->smart_dimming_dsi,
					normal_candela_table[loop],
					normal_tbl->gamma[loop]);

	if (vdd->dtsi_data.hmt_enabled) {
		/* 2st : hmd gamma update */
		for (loop = 0; loop < hmd_step; loop++)
			br_tbl->smart_dimming_dsi_hmt->generate_gamma(
					br_tbl->smart_dimming_dsi_hmt,
					hmd_candela_table[loop],
					hmd_tbl->gamma[loop]);
	} else {
		LCD_ERR("hmt is not support..\n");
	}

	return 0;
}

int table_gamma_update_hmd_S6E3HAB_AMB677TY01(struct samsung_display_driver_data *vdd,
		struct brightness_table *br_tbl)
{
	struct dimming_tbl *hmd_tbl = &br_tbl->hmd_tbl;
	int hmd_step = vdd->br_info.hmd_brightness_step;
	int *hmd_candela_table = hmd_tbl->candela_table;
	int loop;

	LCD_ERR("++\n");

	if (vdd->dtsi_data.hmt_enabled) {
		/* 2st : hmd gamma update */
		for (loop = 0; loop < hmd_step; loop++)
			br_tbl->smart_dimming_dsi_hmt->generate_gamma(
					br_tbl->smart_dimming_dsi_hmt,
					hmd_candela_table[loop],
					hmd_tbl->gamma[loop]);
	} else {
		LCD_ERR("hmt is not support..\n");
	}

	LCD_ERR("--\n");

	return 0;
}

int init_interpolation_S6E3HAB_AMB677TY01(struct samsung_display_driver_data *vdd,
		struct brightness_table *br_tbl, enum INTERPOLATION_MODE mode)
{
	int loop;

	/*
	 * ------------------------------------------------------------------------
	 * 		60NM/60HS	120HS		60NM/60HS(HBM)	120HS(HBM)
	 * ------------------------------------------------------------------------
	 * gamma	CAh				B3h 6th
	 * aor		B1h 1st				B1h 3th
	 * vint		F4h 5th		F4h 29th
	 * elvss	B5h 3rd
	 * irc		92h 11th
	 * ------------------------------------------------------------------------
	 */

	struct PRINT_TABLE print_table_60hz[] = {
		{"GAMMA", 0xCA, 34, 0},
		{"AOR", 0xB1, 2, 0},
		{"VINT", 0xF4, 1, 4},
		{"ELVSS", 0xB5, 3, 2},
		{"IRC", 0x92, 33, 10},
	};

	struct PRINT_TABLE print_table_120hz[] = {
		{"GAMMA", 0xCA, 34, 0},
		{"AOR", 0xB1, 2, 0},
		{"VINT", 0xF4, 1, 28},
		{"ELVSS", 0xB5, 3, 2},
		{"IRC", 0x92, 33, 10},
	};

	struct PRINT_TABLE print_table_hbm_60hz[] = {
		{"GAMMA", 0xB3, 34, 5},
		{"AOR", 0xB1, 2, 2},
		{"VINT", 0xF4, 1, 4},
		{"ELVSS", 0xB5, 3, 2},
		{"IRC", 0x92, 33, 10},
	};

	struct PRINT_TABLE print_table_hbm_120hz[] = {
		{"GAMMA", 0xB3, 34, 5},
		{"AOR", 0xB1, 2, 2},
		{"VINT", 0xF4, 1, 28},
		{"ELVSS", 0xB5, 3, 2},
		{"IRC", 0x92, 33, 10},
	};

	LCD_INFO("mode [%d] ++ : RR: %dhz, HS: %d\n",
			mode, br_tbl->refresh_rate, br_tbl->is_sot_hs_mode);

	/* TODO: this function is called for each vrr mode..
	 * skip below duplicated feature setting, like set_bit()...
	 */

	/* 1 st : update table data at  TABLE_INTERPOLATION mode*/
	if (mode == TABLE_INTERPOLATION)
		table_parsing_data_S6E3HAB_AMB677TY01(vdd, br_tbl);

	/* Even though flash is ok, use table gamma for hmd.
	 * max mtp gamma for hmd is wrong from SDC.
	 */
	table_parsing_data_hmd_S6E3HAB_AMB677TY01(vdd, br_tbl);

	/* 2 nd: init samsung interpolation data */
	vdd->br_info.panel_br_info.itp_mode = mode;

	/* 3 rd: select interpolation info */
	for (loop = 0; loop < BR_INFO_MAX; loop++)
		clear_bit(loop, vdd->br_info.panel_br_info.br_info_select);

	set_bit(BR_HBM_GAMMA, vdd->br_info.panel_br_info.br_info_select);
	set_bit(BR_HBM_AOR, vdd->br_info.panel_br_info.br_info_select);
	set_bit(BR_HBM_VINT, vdd->br_info.panel_br_info.br_info_select);
	set_bit(BR_HBM_ELVSS, vdd->br_info.panel_br_info.br_info_select);
	set_bit(BR_HBM_IRC, vdd->br_info.panel_br_info.br_info_select);

	set_bit(BR_NORMAL_GAMMA, vdd->br_info.panel_br_info.br_info_select);
	set_bit(BR_NORMAL_AOR, vdd->br_info.panel_br_info.br_info_select);
	set_bit(BR_NORMAL_DBV, vdd->br_info.panel_br_info.br_info_select);
	set_bit(BR_NORMAL_VINT, vdd->br_info.panel_br_info.br_info_select);
	set_bit(BR_NORMAL_ELVSS, vdd->br_info.panel_br_info.br_info_select);
	set_bit(BR_NORMAL_IRC, vdd->br_info.panel_br_info.br_info_select);

	set_bit(BR_HMD_GAMMA, vdd->br_info.panel_br_info.br_info_select);
	set_bit(BR_HMD_AOR, vdd->br_info.panel_br_info.br_info_select);

	/* 4 th: init alloc & parsing data */
	set_up_br_info(vdd, br_tbl);

	/* 5 th fill the brightness data which is not from gamma flash, like DBV (for DIA) setting */
	fill_non_flash_data_S6E3HAB_AMB677TY01(vdd, br_tbl);

	/* 6 st: update normal & hmd gamma at TABLE_INTERPOLATION mode*/
	if (mode == TABLE_INTERPOLATION)
		table_gamma_update_S6E3HAB_AMB677TY01(vdd, br_tbl);

	/* 7 th: calculation of interpolation */
	set_up_interpolation(vdd, br_tbl,
		normal_interpolation_table, ARRAY_SIZE(normal_interpolation_table),
		hbm_interpolation_table, ARRAY_SIZE(hbm_interpolation_table));
#if 0
	/* debugging for 512 step */
	set_up_interpolation(vdd,
		normal_interpolation_table_512, ARRAY_SIZE(normal_interpolation_table_512),
		hbm_interpolation_table, ARRAY_SIZE(hbm_interpolation_table));
#endif

	/* For debug */
	if (vdd->debug_data->print_cmds) {
		debug_br_info_log(vdd, br_tbl);
		debug_interpolation_log(vdd, br_tbl);
	}

	/* For printing */
	br_tbl->orig_normal_table = normal_interpolation_table;
	br_tbl->orig_hbm_table = hbm_interpolation_table;

	/* normal brightness */
	br_tbl->print_size = ARRAY_SIZE(print_table_60hz);
	br_tbl->print_table = kmalloc(sizeof(struct PRINT_TABLE) * br_tbl->print_size, GFP_KERNEL);
	if (br_tbl->print_table) {
		if (br_tbl->refresh_rate <= 60)	/* 48/60NM/60HS */
			memcpy(br_tbl->print_table, print_table_60hz, sizeof(print_table_60hz));
		else	/* 96HS/120HS */
			memcpy(br_tbl->print_table, print_table_120hz, sizeof(print_table_120hz));
	} else {
		LCD_ERR("Fail to alloc print_table\n");
	}

	/* hbm brightness */
	br_tbl->print_size_hbm = ARRAY_SIZE(print_table_60hz);
	br_tbl->print_table_hbm = kmalloc(sizeof(struct PRINT_TABLE) * br_tbl->print_size_hbm, GFP_KERNEL);
	if (br_tbl->print_table_hbm) {
		if (br_tbl->refresh_rate <= 60)	/* 48/60NM/60HS */
			memcpy(br_tbl->print_table_hbm, print_table_hbm_60hz, sizeof(print_table_hbm_60hz));
		else	/* 96HS/120HS */
			memcpy(br_tbl->print_table_hbm, print_table_hbm_120hz, sizeof(print_table_hbm_120hz));
	} else {
		LCD_ERR("Fail to alloc print_table_hbm\n");
	}


	LCD_INFO("mode [%d] -- : RR: %dhz, HS: %d\n",
			mode, br_tbl->refresh_rate, br_tbl->is_sot_hs_mode);

	return 1;
}

