/*
 * convert_GAMMA_to_V : convert CA gamma reg to V format
 * src : packed gamma value (CAh)
 * dst : extened V values (V255 ~ VT)
 */
void convert_GAMMA_to_V(unsigned char* src, unsigned int *dst)
{
	/* i : V index
	 * j : RGB index
	 * k : extend V index
	 */
	int i,j,k = 0;

	memset(dst, 0, V_MAX * RGB_MAX * sizeof(int));

	for (i = V255; i >= VT; i--) {
		for (j = R; j < RGB_MAX; j++) {
			if (i == V255) {
				if (j == R) { /* k = 0 */
					dst[k] |= GET_BITS(src[0], 4, 5) << 8;
					dst[k] |= GET_BITS(src[1], 0, 7);
				} else if (j == G) { /* k = 1 */
					dst[k] |= GET_BITS(src[0], 2, 3) << 8;
					dst[k] |= GET_BITS(src[2], 0, 7);
				} else if (j == B) { /* k = 2 */
					dst[k] |= GET_BITS(src[0], 0, 1) << 8;
					dst[k] |= GET_BITS(src[3], 0, 7);
				}
			} else if (i == V0) {
				if (j == R)  /* k = 30 */
					dst[k] |= GET_BITS(src[31], 4, 7);
				else if (j == G) /* k = 31 */
					dst[k] |= GET_BITS(src[31], 0, 3);
				else if (j == B) /* k = 32 */
					dst[k] |= GET_BITS(src[32], 4, 7);
			} else if (i == VT) {
				if (j == R) /* k = 33 */
					dst[k] |= GET_BITS(src[32], 0, 3);
				else if (j == G) /* k = 34 */
					dst[k] |= GET_BITS(src[33], 4, 7);
				else if (j == B) /* k = 35 */
					dst[k] |= GET_BITS(src[33], 0, 3);
			} else { /* V203 ~ V1, k = 3 ~ 29 */
				dst[k] = GET_BITS(src[k + 1], 0, 7);
			}

			k++;
		}
	}

	LCD_DEBUG("src[0~3] = %02x %02x %02x %02x\n", src[0], src[1], src[2], src[3]);
	LCD_DEBUG("src[31~33] = %02x %02x %02x \n", src[31], src[32], src[33]);

	return;
}

/*
 * convert_V_to_GAMMA : convert V format to CAh gamma reg
 * src : extened V values (V255 ~ VT)
 * dst : packed gamma values (CAh)
 */
void convert_V_to_GAMMA(unsigned int *src, unsigned char* dst)
{
	/* i : gamma index
	 * k : packed gamma index
	 */
	int i,k = 0;

	memset(dst, 0, GAMMA_SET_MAX);

	for (i = 0; i < GAMMA_SET_MAX; i++) {
		if (i == 0) {
			dst[i] |= GET_BITS(src[k], 8, 9) << 4;
			dst[i] |= GET_BITS(src[k+1], 8, 9) << 2;
			dst[i] |= GET_BITS(src[k+2], 8, 9);

		} else if (i >= 31) {
			dst[i] |= GET_BITS(src[k++], 0, 4) << 4;
			dst[i] |= GET_BITS(src[k++], 0, 4);
		} else {
			dst[i] |= GET_BITS(src[k++], 0, 7);
		}
	}

	LCD_DEBUG("src[0~2] = %02x %02x %02x \n", src[0], src[1], src[2]);
	LCD_DEBUG("dst[0] = %02x \n", dst[0]);

	return;
}

void gen_hbm_interpolation_gamma_S6E3HAB_AMB677TY01(struct samsung_display_driver_data *vdd,
		struct brightness_table *br_tbl,
		struct ss_interpolation_brightness_table *normal_table, int normal_table_size)
{
	struct ss_interpolation *ss_itp;

	unsigned char *normal_max_gamma = br_tbl->normal_tbl.gamma[0];
	unsigned char **hbm_itp_gamma;
	int **hbm_temp_gamma;
	unsigned char *hbm_max_gamma = br_tbl->hbm_tbl.gamma[0];
	int normal_max_cd;

	int hbm_itp_step;
	int hbm_max_cd;
	int *hbm_itp_cd;

	int gamma_size = vdd->br_info.gamma_size;
	int gamma_V_size = get_gamma_V_size_S6E3HAB_AMB677TY01();
	int *normal_max_gammaV;
	int *hbm_max_gammaV;

	int i, j;

	if (vdd->br_info.panel_br_info.itp_mode == FLASH_INTERPOLATION)
		ss_itp = &br_tbl->flash_itp;
	else
		ss_itp = &br_tbl->table_itp;

	hbm_itp_gamma = ss_itp->hbm.gamma;

	normal_max_cd = ss_itp->normal.br_aor_table[ss_itp->normal.brightness_step - 1].lux_mode;

	hbm_itp_step = ss_itp->hbm.brightness_step;
	hbm_max_cd = ss_itp->hbm.br_table[hbm_itp_step - 1].lux_mode;

	normal_max_gammaV = kzalloc(gamma_V_size * sizeof(int), GFP_KERNEL);
	if (!normal_max_gammaV) {
		LCD_ERR("fail to alloc normal_max_gammaV %d\n", __LINE__);
		return;
	}

	hbm_max_gammaV = kzalloc(gamma_V_size * sizeof(int), GFP_KERNEL);
	if (!hbm_max_gammaV) {
		LCD_ERR("fail to alloc hbm_max_gammaV %d\n", __LINE__);
		goto alloc_fail1;
	}

	/* alloc 2 dimenstion matrix */
	hbm_temp_gamma = kzalloc(hbm_itp_step * sizeof(void *), GFP_KERNEL);
	if (!hbm_temp_gamma) {
		LCD_ERR("fail to alloc hbm_temp_gamma %d\n", __LINE__);
		goto alloc_fail2;
	}

	for (i = 0; i < hbm_itp_step; i++) {
		hbm_temp_gamma[i] = kzalloc(gamma_V_size * sizeof(int), GFP_KERNEL);

		if (!hbm_temp_gamma[i]) {
			LCD_ERR("fail to alloc  hbm_temp_gamma %d\n", __LINE__);
			goto alloc_fail3;
		}
	}

	hbm_itp_cd = kzalloc(hbm_itp_step * sizeof(int), GFP_KERNEL);
	if (!hbm_itp_cd) {
		LCD_ERR("fail to alloc hbm_itp_cd %d\n", __LINE__);
		goto alloc_fail3;
	}

	for (i = 0; i < hbm_itp_step; i++) {
		hbm_itp_cd[i] = ss_itp->hbm.br_table[i].interpolation_br_x10000;
		LCD_DEBUG("%d candela : %d\n", i, hbm_itp_cd[i]);
	}

	/* 1. Make V format from GAMMA format */
	convert_GAMMA_to_V(normal_max_gamma, normal_max_gammaV);
	convert_GAMMA_to_V(hbm_max_gamma, hbm_max_gammaV);

	LCD_DEBUG("gamma_size %d / gamma_V_size %d \n", gamma_size, gamma_V_size);
	for (i = 0; i < gamma_V_size; i++)
		LCD_DEBUG("[%d] 0x%x 0x%x\n", i, hbm_max_gammaV[i], normal_max_gammaV[i]);

	/*
	 * 2. HBM GAMMA Interpolation. (V format base)
	 */
	for (i = 0 ; i < hbm_itp_step; i++) {
		for (j = 0; j < gamma_V_size; j++) {
			hbm_temp_gamma[i][j] =
				gamma_interpolation(hbm_max_gammaV[j], normal_max_gammaV[j], hbm_max_cd, normal_max_cd, hbm_itp_cd[i]);
		}
	}

	/* update max hbm gamma with origin hbm gamma */
	for (i = 0; i < gamma_V_size; i++)
		hbm_temp_gamma[hbm_itp_step - 1][i] = hbm_max_gammaV[i];

	/* 3. Make GAMMA format from V format */
	for (i = 0; i < hbm_itp_step; i++)
		convert_V_to_GAMMA(hbm_temp_gamma[i], hbm_itp_gamma[i]);

	kfree(hbm_itp_cd);

alloc_fail3:
	for (i = 0; i < hbm_itp_step; i++)
		kfree(hbm_temp_gamma[i]);
	kfree(hbm_temp_gamma);
alloc_fail2:
	kfree(hbm_max_gammaV);
alloc_fail1:
	kfree(normal_max_gammaV);
}

void gen_hbm_interpolation_irc_S6E3HAB_AMB677TY01(struct samsung_display_driver_data *vdd,
		struct brightness_table *br_tbl,
		struct ss_interpolation_brightness_table *hbml_table, int hbm_table_size)
{
	int loop;
	struct ss_hbm_interpolation *hbm_itp;
	int hbm_interpolation_step;

	unsigned int irc_size = vdd->br_info.irc_size;
	unsigned char *normal_max_candela_irc = br_tbl->normal_tbl.irc[0]; /* flash data write oder */

	unsigned char **dest_irc;
	unsigned long long normal_max_br = br_tbl->normal_tbl.candela_table[0]; /* flash data write oder */
	unsigned int hbm_max_br = br_tbl->hbm_tbl.candela_table[0]; /* flash data write oder */

	unsigned long long cur_br_x10000, color, mtp;
	int reg_idx, irc;
	unsigned long long val1, val2, val3, val4, val5, res;

	if (vdd->br_info.panel_br_info.itp_mode == FLASH_INTERPOLATION)
		hbm_itp = &br_tbl->flash_itp.hbm;
	else
		hbm_itp = &br_tbl->table_itp.hbm;

	hbm_interpolation_step = hbm_itp->brightness_step;
	dest_irc = hbm_itp->irc;

	LCD_DEBUG("hbm_interpolation_step : %d \n", hbm_interpolation_step);

	for (loop = 0; loop < hbm_interpolation_step; loop++) {
		/* copy default irc string */
		memcpy(dest_irc[loop], normal_max_candela_irc, irc_size);

		cur_br_x10000 = hbm_itp->br_table[loop].interpolation_br_x10000;

		for (mtp = IRC_0_V1; mtp < IRC_V1_MAX; mtp++) {
			for (color = RED_ORDER; color < COLOR_ORDER_MAX; color++) {

				reg_idx = IRC_START_OFFSET + (COLOR_ORDER_MAX * mtp) + color;
				irc = (int)normal_max_candela_irc[reg_idx];

				/*
				 * ROUND(current_br / normal_max_br) * irc * (1 + (0.7 - 1) / (800 - 420) * (current_br - 420)), 0)
				 */

				val1 = (cur_br_x10000 * irc) / normal_max_br;
				val2 = cur_br_x10000 - (normal_max_br * MULTIPLY_x10000);
				val3 = val2 * 4 / 10;
				val4 = val3 * MULTIPLY_x100 / (hbm_max_br - normal_max_br);
				val5 = 1 * MULTIPLY_x10000 * MULTIPLY_x100 - val4;

				res = val1 * val5 / MULTIPLY_x10000 / MULTIPLY_x10000;
				res = ROUNDING(res, MULTIPLY_x100) / MULTIPLY_x100;

				dest_irc[loop][reg_idx] = res;

				LCD_DEBUG("[%d][%d] %x(%d) %d %d %d => %x(%d)\n", loop, reg_idx,
					irc, irc, cur_br_x10000, normal_max_br, hbm_max_br, dest_irc[loop][reg_idx], dest_irc[loop][reg_idx]);
			}
		}
	}
}

void gen_normal_interpolation_irc_S6E3HAB_AMB677TY01(struct samsung_display_driver_data *vdd,
		struct brightness_table *br_tbl,
		struct ss_interpolation_brightness_table *normal_table, int normal_table_size)
{
	int loop;
	int normal_interpolation_step;
	struct ss_normal_interpolation *normal_itp;
	unsigned char **dest_irc;

	unsigned int irc_size = vdd->br_info.irc_size;
	unsigned char *normal_max_candela_irc = br_tbl->normal_tbl.irc[0]; /* flash data write oder */
	unsigned int normal_max_br = br_tbl->normal_tbl.candela_table[0]; /* flash data write oder */

	unsigned int cur_br_x10000, color, mtp;
	int reg_idx, irc;
	unsigned int val1;

	if (vdd->br_info.panel_br_info.itp_mode == FLASH_INTERPOLATION)
		normal_itp = &br_tbl->flash_itp.normal;
	else
		normal_itp = &br_tbl->table_itp.normal;

	normal_interpolation_step = normal_itp->brightness_step;
	dest_irc = normal_itp->irc;

	LCD_DEBUG("normal_interpolation_step : %d \n", normal_interpolation_step);

	for (loop = 0; loop < normal_interpolation_step; loop++) {
		/* copy default irc string */
		memcpy(dest_irc[loop], normal_max_candela_irc, irc_size);

		cur_br_x10000 = normal_itp->br_aor_table[loop].interpolation_br_x10000;

		for (mtp = IRC_0_V1; mtp < IRC_V1_MAX; mtp++) {
			for (color = RED_ORDER; color < COLOR_ORDER_MAX; color++) {

				reg_idx = IRC_START_OFFSET + (COLOR_ORDER_MAX * mtp) + color;
				irc = (int)normal_max_candela_irc[reg_idx];
				val1 = (irc * cur_br_x10000) / normal_max_br;

				dest_irc[loop][reg_idx] = ROUNDING(val1 / MULTIPLY_x100, MULTIPLY_x100) / MULTIPLY_x100;

				LCD_DEBUG("[%d][%d] %x(%d) %d %d => %x(%d)\n", loop, reg_idx,
					irc, irc, cur_br_x10000, normal_max_br, dest_irc[loop][reg_idx], dest_irc[loop][reg_idx]);
			}
		}
	}
}

